        <li>Nick Hofmann</li>
    </ul>

    <p><strong>Noah Clark's Original Pitch:</strong></p>
    <p>For this project the user will be able to use this web app to create characters for Fifth Edition Dungeons and Dragons. After creating a log in, users will be able to view any characters they've created previously listed out on a table, with button prompts next to each characte");
                WriteLiteral(@"r allowing them to edit or delete them. In addition, a button at the top of this table will allow the user to create a new character. This will lead them to a second page where they can enter in information to create a new character, alongside two buttons to either randomize the entire form or to randomize empty fields. The Edit action will act in a similar way, but prepopulating the fields with the desired character's information and affecting that character's entry.  All of the relavent information will be stored on an SQL database, the various Classes, Races, and Backgrounds, alongside a User and Character database, allowing for people to create logins and retain character information. Finally, if a user is granted admin permission, they will have access to a page allowing them to manipulate the database, alongside moderating for unwelcome behavior.</p>
    <p>The above paragraph covers what I view as essential to the project, from here on are ideas I would like to add if I have the time. If at all possib");
